%% ION EXCHANGE MODEL - ONLY ACCOUNTS FOR OPERATION, NO RENGERATION OF THE COLUMN

%% TEST FILE
%Code solves for the equilibrium of anions in water simultaneous 

%Code divides an ion exchange column into a set number of segments (m).
%These segments are defined by their capacity as meq/L. A meq is charged
%based measurement of the anions is water. For example 1mmole of NO3- is
%1meq. 1mmole of SO42- is 2meq. 

%The incoming water is divided into similar volume size as the segments in
%the column and are known as packets of water (n). Each packet of water is
%assumed to be in instantaneous equilibrium with the column. The
%equilibrium of the anions with the column is determined by the equilbrium
%coefficients (K). Five anions are studied in this experiment - nitrate,
%sulfate, bicarbonate, chloride and perchlorate.

%% WATER CONSTITUENT FILES

load('Cl_Influent_1000.mat')
load('NO3_Influent_1000.mat')
load('HCO3_Influent_1000.mat')
load('SO4_Influent_1000.mat')
load('ClO4_Influent_10_1000.mat')

%milliequilavent conversion for chloride
Cl_meq=1/35.45; 
%milliequilavent conversion for nitrate
NO3_meq=1/62.0049;
%milliequilavent conversion for sulfate - sulfate has a 2 in the numerator
%for the -2 charge on the anion
SO4_meq=2/96.06;
%milliequilavent conversion for bicarbonate
HCO3_meq=1/61.0168;
%milliequilavent conversion for perchlorate - 1000 is included in the
%denominator as the perchlorate concentrations are reported as ug/L
ClO4_meq=1/(99.45*1000);

Cl_Inf=Cl_Influent_1000*Cl_meq; 
NO3_Inf=NO3_Influent_1000*NO3_meq;
HCO3_Inf=HCO3_Influent_1000*HCO3_meq;
SO4_Inf=SO4_Influent_1000*SO4_meq;
ClO4_Inf=ClO4_Influent_10_1000*ClO4_meq; %includes perchlorate concentrations above the 10ug/L treatment

%%INITIAL PARAMETERS
tic     %Start Timer

%Default values constants
TR = 1000; 
% Total # of resin sites in meq/L in the column
KNC = 10; 
% Equilibrium constant (K) value between nitrate and chloride
KHC = 0.3; 
% K value between bicarbonate and chloride
KSC = 0.004;
% K value between sulfate and chloride
KCC = 26000; 
%K value between perchlorate and chloride
%Resin matrix (initial condition) - Initial assumption that KCC and KNC are
%equal

m = 5; 
%number of segments that the column is divided into add 1 - the 1 accounts 
%for the initial conditions of the column
n = 700000*m; %Initial estimate for the muber of bed volumnes (BV) treated.
%code will stop once breakthrough of contaminants occurs. 
%q=1; %initial location in the Monte Carlo simulation to be evaluated. 
%Currently run time suggests a set of 10 simulations
%r=100; %final location in the Monte Carlo simulation to be evaluated.

%p = (r+1)-q; %number of Monte Carlo simulations done for the range of anion
%concentrations

%Set up the size of the Resin matrix.
%RESIN=zeros(n+1,m);
% RESIN.Cl = zeros(n+1,m);
% RESIN.NO3 = zeros(n+1,m);
% RESIN.HCO3 = zeros(n+1,m);
% RESIN.SO4 = zeros(n+1,m);
% RESIN.ClO4 = zeros(n+1,m);

%Set up the size of the water matrix
%WATER=zeros(n,m+1);
% WATER.Cl = zeros(n,m+1); 
% WATER.NO3 = zeros(n,m+1); 
% WATER.HCO3 = zeros(n,m+1); 
% WATER.SO4 = zeros(n,m+1); 
% WATER.ClO4 = zeros(n,m+1); 

% bed_volumes=zeros(p,1);


%IX run part
%note the RESIN.Cl form is referred to as a structure. 


